import React, { useState } from "react";
import "./filters.css";

const Filters = ({ onFilter }) => {
  const [batch, setBatch] = useState("");
  const [program, setProgram] = useState("");
  const [search, setSearch] = useState("");
  const [sscPercentage, setSSCPercentage] = useState("");
  const [hscPercentage, setHSCPercentage] = useState("");
  const [bachelorPercentage, setBachelorPercentage] = useState("");
  const [drops, setDrops] = useState("");

  // Function to handle filtering
  const handleFilterChange = (filterType, value) => {
    if (filterType === "batch") {
      setBatch(value);
    } else if (filterType === "program") {
      setProgram(value);
    } else if (filterType === "search") {
      setSearch(value);
    } else if (filterType === "sscPercentage") {
      setSSCPercentage(value);
    } else if (filterType === "hscPercentage") {
      setHSCPercentage(value);
    } else if (filterType === "bachelorPercentage") {
      setBachelorPercentage(value);
    } else if (filterType === "drops") {
      setDrops(value);
    }

    onFilter(filterType, value); // Call the parent callback function
  };

  return (
    <div className="filters">
      <div>
        <label>Batch</label>
        <select
          className="select"
          value={batch}
          onChange={(e) => handleFilterChange("batch", e.target.value)}
        >
          <option value="">Select Batch</option>
          <option value="21-23">21-23</option>
          <option value="2023-2024">2023-2024</option>
        </select>
      </div>

      <div>
        <label>Program</label>
        <select
          className="select"
          value={program}
          onChange={(e) => handleFilterChange("program", e.target.value)}
        >
          <option value="">Select Program</option>
          <option value="MCA">MCA</option>
          <option value="B.Tech">B.Tech</option>
        </select>
      </div>

      <div>
        <img src="/Images/Search.png" height="22px" width="22px" alt="search" />
        <input
          type="text"
          placeholder="Search..."
          value={search}
          onChange={(e) => handleFilterChange("search", e.target.value)}
        />
      </div>

      <div>
        <label>SSC Percentage</label>
        <select
          className="select"
          value={sscPercentage}
          onChange={(e) => handleFilterChange("sscPercentage", e.target.value)}
        >
          <option value="">Select SSC Percentage</option>
          <option value="<50">&lt;50%</option>
          <option value="<60">&lt;60%</option>
          <option value="<70">&lt;70%</option>
          <option value="<80">&lt;80%</option>
        </select>
      </div>

      <div>
        <label>HSC Percentage</label>
        <select
          className="select"
          value={hscPercentage}
          onChange={(e) => handleFilterChange("hscPercentage", e.target.value)}
        >
          <option value="">Select HSC Percentage</option>
          <option value="<50">&lt;50%</option>
          <option value="<60">&lt;60%</option>
          <option value="<70">&lt;70%</option>
          <option value="<80">&lt;80%</option>
        </select>
      </div>

      <div>
        <label>Bachelor's Percentage</label>
        <select
          className="select"
          value={bachelorPercentage}
          onChange={(e) => handleFilterChange("bachelorPercentage", e.target.value)}
        >
          <option value="">Select Bachelor's Percentage</option>
          <option value="<50">&lt;50%</option>
          <option value="<60">&lt;60%</option>
          <option value="<70">&lt;70%</option>
          <option value="<80">&lt;80%</option>
        </select>
      </div>

      <div>
        <label>Drops</label>
        <select
          className="select"
          value={drops}
          onChange={(e) => handleFilterChange("drops", e.target.value)}
        >
          <option value="">Select Drops</option>
          <option value="0">0</option>
          <option value="1">1</option>
          <option value="2">2</option>
          <option value="3">3</option>
          <option value="4">4+</option>
        </select>
      </div>
    </div>
  );
};

export default Filters;
